import React, { Component } from 'react';
import './App.css';
import Clarifai from 'clarifai';
import Navigation from './Components/Navigation/Navigation';
import Logo from './Components/Logo/Logo';
import ImageLinkForm from './Components/ImageLinkFrom/ImageLinkForm';
import Rank from './Components/Rank/Rank';
import Prtls from './Components/Particles/Particles';
import FaceRecognition from './Components/FaceRecognition/FaceRecognition';

    const USER_ID = 'hadi_01';
    const PAT = '9a0cf551bffe4b2ab6c4c5903d0a6e79';
    const APP_ID = 'First-Application';
   // const API_KEY =  'eec46ed0322e4dfab533a8a76f938c64';
    const MODEL_ID = 'general-image-recognition';
    const MODEL_VERSION_ID = 'aa7f35c01e0642fda5cf400f543e7c40';    // const IMAGE_URL = ' ';
   // const IMAGE_URL = this.state.input;

    const raw = JSON.stringify({
      "user_app_id": {
          "user_id": USER_ID,
          "app_id": APP_ID
      },
      "inputs": [
          {
              "data": {
                  "image": {
                      "url": " "
                  }
              }
          }
      ]
  });


class  App extends Component {
  constructor(){
    super();
    this.state={
      input: '',
      IMAGEURL: '',
    }
  }

   onInputChange = (event) => {
    // this.setstate({input: event.target.value});
    this.setState({input: event.target.value});
  }

  onTap = ()=>{


    this.setState({IMAGEURL: this.state.input});


    const requestOptions = {
      method: 'POST',
      headers: {
          'Accept': 'application/json',
          'Authorization': 'Key ' + PAT
      },
      body: raw
  };
  // fetch("https://api.clarifai.com/v2/models/" + MODEL_ID + MODEL_VERSION_ID + "/outputs", requestOptions)
  raw.models

// HEADS UP! Sometimes the Clarifai Models can be down or not working as they are constantly getting updated.
// A good way to check if the model you are using is up, is to check them on the clarifai website. For example,
// for the Face Detect Mode: https://www.clarifai.com/models/face-detection
// If that isn't working, then that means you will have to wait until their servers are back up. Another solution
// is to use a different version of their model that works like the ones found here: https://github.com/Clarifai/clarifai-javascript/blob/master/src/index.js
// so you would change from:
// .predict(Clarifai.FACE_DETECT_MODEL, this.state.input)
// to:
.predict('53e1df302c079b3db8a0a36033ed2d15', this.state.input)
      .then(response => response.json())
      .then(result => console.log(result))
      .catch(error => console.log('error', error));

}
  render() {
    return (
      <div className="App">
        <Prtls className="particles"/>
      <Navigation />
       <Logo />
       <Rank />
      <ImageLinkForm 
      onInputChange={this.onInputChange} 
      onTap={this.onTap} />
      <FaceRecognition IMAGEURL={this.state.IMAGEURL} />
    </div>
  );
}
}

export default App;
